import CommentsCall from "./AdminContactCall";



export default function AdminContact() {


 return (

    <Container>
        <div className="admin-contact-container">
        <Heading content="Kommentarer" />
        <div className="admin-contact-content-container">
            <CommentsCall />
        </div>
    </div>
    </Container>
 );
}
